package com.rongke.model;import com.baomidou.mybatisplus.annotations.TableField;import com.baomidou.mybatisplus.annotations.TableId;import com.baomidou.mybatisplus.annotations.TableName;import com.baomidou.mybatisplus.enums.IdType;import com.fasterxml.jackson.annotation.JsonFormat;import java.io.Serializable;/** * @User * @用户(user) * @version : Ver 1.0 */@TableName("sys_deciding")public class SysDeciding implements Serializable {	@TableField(exist = false)	private static final long serialVersionUID = 1L;	/**	 * @备注:用户表id	 * @字段:id BIGINT(19)	 */	@TableId(type = IdType.AUTO)	@JsonFormat(shape = JsonFormat.Shape.STRING)	private Long id;	/**	 * 名字	 */	private String jcName;	/**	 * 是否开启	 */	private Boolean jcOpen;	/**	 * key	 */	private String jcKey;	/**	 * value	 */	private String jcValue;	/**	 * 执行方式	 */	private Integer jcType;	public Long getId() {		return id;	}	public void setId(Long id) {		this.id = id;	}	public String getJcName() {		return jcName;	}	public void setJcName(String jcName) {		this.jcName = jcName;	}	public Boolean getJcOpen() {		return jcOpen;	}	public void setJcOpen(Boolean jcOpen) {		this.jcOpen = jcOpen;	}	public String getJcKey() {		return jcKey;	}	public void setJcKey(String jcKey) {		this.jcKey = jcKey;	}	public String getJcValue() {		return jcValue;	}	public void setJcValue(String jcValue) {		this.jcValue = jcValue;	}	public Integer getJcType() {		return jcType;	}	public void setJcType(Integer jcType) {		this.jcType = jcType;	}	@Override	public String toString() {		return "SysDeciding{" +				"id=" + id +				", jcName='" + jcName + '\'' +				", jcOpen=" + jcOpen +				", jcKey='" + jcKey + '\'' +				", jcValue='" + jcValue + '\'' +				", jcType=" + jcType +				'}';	}}